    "link": "https://www.hackerrank.com/challenges/connected-cell-in-a-grid",
    "message": "One of the basic techniques of solving algorithmic graph (data structure) based problems is depth-first-search. It's more fun applying DFS to a real problem such as finding a path between two points in a graph setup or finding a path between two cells in a grid (think of 2d strategy games, etc). Applying a DFS to a hacker rank problem was a good way to learn.\n\nHere is a gist (github) of my solution (C#): https://gist.github.com/khalilovcmd/ae4de755595c030f36ba\n\nedit: and for anyone interested, I will provide a clearer implementation of a depth-first search algorithm in a gist later.",
