    "message": "vNext, ASP.NET 5 .. Microsoft have finally understood that tools such as Bower (for modules), Grunt (for build), and moving away from the tedious IIS countless configurations, and allow cloud/self hosting is the way to move forward with web development. Take a look at the \"Heroku\" and Cloud9 IDE or Sublime Text 2 and how it have changed the way we build web apps.\n\nWeb Dev of the future is - more javascript, testable RESTful API, faster testing / deployment cycle and lesser database setup complexity.\n\nGood work Microsoft.",
