    "description": "How would the unprotected human body react to the vacuum of outer space? \n\nWould it inflate to bursting? or would it not? or would just the interior gases hyperinflate? We are also relating this to short-term exposure only. This question primarily relates to the pressure differential problems. Temperature or radiation considerations would be interesting as well.\n\nHow long can a human live unprotected in space?\n\nIf you don't try to hold your breath, exposure to space for half a minute or so is unlikely to produce permanent injury. Holding your breath is likely to damage your lungs, something scuba divers have to watch out for when ascending, and you'll have eardrum trouble if your Eustachian tubes are badly plugged up, but theory predicts -- and animal experiments confirm -- that otherwise, exposure to vacuum causes no immediate injury. You do not explode. Your blood does not boil. You do not freeze. You do not instantly lose consciousness.\n\nVarious minor problems (sunburn, possibly \"the bends\", certainly some [mild, reversible, painless] swelling of skin and underlying tissue) start after ten seconds or so. At some point you lose consciousness from lack of oxygen. Injuries accumulate. After perhaps one or two minutes, you're dying. The limits are not really known.\n\nYou do not explode and your blood does not boil because of the containing effect of your skin and circulatory system. You do not instantly freeze because, although the space environment is typically very cold, heat does not transfer away from a body quickly. Loss of consciousness occurs only after the body has depleted the supply of oxygen in the blood. If your skin is exposed to direct sunlight without any protection from its intense ultraviolet radiation, you can get a very bad sunburn.\n\nAt NASA's Johnson Space Center they had a test subject accidentally exposed to a near vacuum (less than 1 psi) in an incident involving a leaking space suit in a vacuum chamber back in '65. He remained conscious for about 14 seconds, which is about the time it takes for O2 deprived blood to go from the lungs to the brain. The suit probably did not reach a hard vacuum, and we began repressurizing the chamber within 15 seconds. The subject regained consciousness at around 15,000 feet equivalent altitude. The subject later reported that he could feel and hear the air leaking out, and his last conscious memory was of the water on his tongue beginning to boil.",
    "from": {
      "name": "Tarek Saber",
      "id": "10202644602507831"
    },
