    "message": "Facts that I recently knew about Japan: \n\nFor starters, they have one of the lowest birth rate in the world, 1/3 of the country is above 65 years old (Japan's population is 120M). The life expectancy in Japan is estimated 84 years old, the highest in the world. They have more than 60,000 people who are above 100 years old. And at last, they do have one of the lowest crime rates in the world. A big portion of their men are starting to prefer Manga (Anime) girlfriends or wives than real relationships, and that causes even more severe low birth rates.\n\nThere is a town in Japan called Yubari that has a population of 10,000 people, and have ZERO birth rate, they have no new borns, and they have closed almost all of their schools except one.\n\n#japan #birthrate",
